pragma solidity 0.4.19;


contract CANSign {

    struct Signer {
        address signer;
        uint256 name;
        uint256 dateOfBirth;
        uint256 signedAt;
    }

    struct Document {
        uint256 hash;
        address creator;
        uint256 expirationDate;
        mapping (address => Signer) signers;
    }

    mapping (uint256 => Document) documents;

    function CANSign() public {}

    function addDocument(uint256 _hash, address _creator, uint256 _expirationDate) public {
        documents[_hash] = Document({
            hash: _hash,
            creator: _creator,
            expirationDate: _expirationDate
            });
    }

    function getDocument(uint256 _hash) view public returns (uint256) {
        return documents[_hash].hash;
    }

}
